// src/components/WhiskyCard.tsx
import React from 'react';
import { Link } from 'react-router-dom';

interface Whisky {
  id: number;
  name: string;
  image: string;
  region: string;
}

interface WhiskyCardProps {
  whisky: Whisky;
}

const WhiskyCard: React.FC<WhiskyCardProps> = ({ whisky }) => {
  return (
    <div className="whisky-card">
      <img src={whisky.image} alt={whisky.name} />
      <h3>{whisky.name}</h3>
      <p>{whisky.region}</p>
      <Link to={`/whiskies/${whisky.id}`}>View Details</Link>
    </div>
  );
};

export default WhiskyCard;
